import React from 'react';
import htmlImage from "../image/html-css.jpeg";

function Skills() {
  return (
    <div className='skills-main'>
        <div className='skills-title'>
          Skills
          <div className='skills-content'>

              <img src={htmlImage} />

            </div>
          </div>


    </div>
  )
}

export default Skills;
